/**
 * An aggregation of samples collected during the sample period.
 */
export interface IStat {
    /**
     * The minimum sampled value.
     */
    min: number;
    /**
     * The maximum sampled value.
     */
    max: number;
    /**
     * The sum of sampled values.
     */
    sum: number;
    /**
     * The count of sampled values.
     */
    count: number;
    [key: string]: number;
}
